import React from 'react'
import Logo from './Airbnb_Logo.png'

export default function Navbar () {
    return (

        <nav className="nav">
            <img src={Logo}/>

            <div className="header_center">
                <input type="text" />
                <SearchIcon />
            </div>
        </nav>

    )
}
